import RouteShopping from './routes/web';
import configStore from './redux/store';
import { PersistGate } from 'redux-persist/integration/react'

const {store, persistor} = configStore();

const AppShopping = () => {
    return (
        <Provider store={store}>
            <RouteShopping/>
        </Provider>
    )
}

